import styled from 'styled-components'

export const NoteWrapper = styled.div``

export const NoteColumn = styled.ul``

export const Note = styled.div`
  width: 220px;
  margin-bottom: 20px;
  border-radius: 8px;
  box-shadow: 0 1px 2px 0 rgba(0, 0, 0, 0.1);
  cursor: pointer;
  // :hover
  .note-img {
    width: 220px;
  }
  h3 {
    margin: 10px 15px;
    font-size: 16px;
    font-weight: 400;
    color: #000;
  }
  .user-img {
    width: 28px;
    height: 28px;
    border-radius: 50%;
  }
  span {
    font-size: 12px;
    color: #555;
  }
  .heart {
    // url(data:image/png;base64,);
    color: #333;
  }
`
export const QrCode = styled.div``
